import { useNavigate } from "react";
import "./Movie.css";

interface Movie {
  poster?: string;
  title: string;
  crawl: string;
  date: string;
  id: number;
}

const Movie: React.FC<Movie> = ({ poster, title, crawl, date, id }) => {
  return (
    <div className="movie__card">
      <img
        src={poster}
        alt="Movie Poster"
        onClick={() => localStorage.setItem("id", JSON.stringify({ id }))}
      />
      <div className="movie__description">
        <p>{title}</p>
        <span>{date}</span>
        <p> {crawl}</p>
      </div>
    </div>
  );
};

export default Movie;
